export class SquareModel{
    private color:string;
    private pos:string;

    public constructor(color:string,pos:string){
        this.color = color;
        this.pos = pos;
    }

    public getColor():string{
        return this.color;
    }
    public getPos():string{
        return this.pos;
    }
}
